import React from 'react';
import '../styles/Signup.css'; // Import the CSS file

function Signup() {
  return (
    <div className="signup-page">
      <div className="signup-container">
        <h1>Car Park</h1>
        <div className="signup-form">
          <input type="text" placeholder="Full Name" className="signup-input-field" />
          <input type="text" placeholder="Phone number" className="signup-input-field" />
          <input type="email" placeholder="Email" className="signup-input-field" />
          <input type="password" placeholder="Password" className="signup-input-field" />
          <button className="signup-button">Signup</button>
          <p className="login-text">Already have an account? <a href="/login">Login</a></p>
        </div>
      </div>
    </div>
  );
}

export default Signup;
